import React from 'react';

function MyProject() {
  return (
    <section id="about" className="bg-white py-12 text-gray-800">
      <div className="container mx-auto text-center">
        <h2 className="text-3xl font-bold mb-6">About Me</h2>
        <p className="text-lg">
          I am a passionate developer with experience in building web applications using modern technologies like React and Tailwind CSS.
        </p>
      </div>
    </section>
  );
}

export default MyProject;
